/**
 * grid初始化查询行为 列表查询行为方法
 * 该方法只支持后台方法有且只有一个参数，且参数类型为对象（vo）
 * 若是多条件查询，需把条件封装在vo中
 * @obj grid对象
 * @pageQuery grid分页信息
 */
function gridDatasource(obj, pageQuery) {
	var queryVarName = 'car';
	var query = {};
	if(queryVarName !== ''){
		query=cap.getQueryObject(window[queryVarName],pageQuery);
	}
	//初始化查询参数

	//获取查询条件
 	var paramArray = [];
 	paramArray[0] = query;
 	var aliasEntityId = '';
	aliasEntityId = aliasEntityId != '' ? aliasEntityId :  'com.comtop.meeting.entity.Car';
 	var dwrInvokeParam = cap.getDwrInvokeParam(aliasEntityId,'queryTodoVOListByPage',paramArray);
 	//TODO 调用前操作


 	//调用后台查询
 	dwr.TOPEngine.setAsync(true);
	AgainTestToDoListPageAction.dwrInvoke(dwrInvokeParam,{callback:function(result){
		var returnValueVarName= 'carList';
		if(returnValueVarName === ''){
			returnValueVarName = 'returnValueVarName';
		}
  		//TODO 数据设置前操作

  		window[returnValueVarName]=result.list;
  		//设置到数据源
  		if(result.list!=null){
  			obj.setQuery({pageNo:result.pageNo});
  			obj.setDatasource(result.list,result.count); 
      	}else{
      		obj.setDatasource([],0);
      	}
  		//TODO 数据设置后操作

  		//查询条件保存设置
  		var saveQueryData='yes';
  		if(saveQueryData=='yes'){
  			cap.setSessionAttribute({'car' : cap.cacheGridAttributes(obj.getQuery(), window['car'])});
  		}
  	},
  	errorHandler:function(message, exception){
	   //TODO 后台异常信息回调

	}
  	});
  	dwr.TOPEngine.setAsync(true);
  	//TODO 可自定义设置返回值

}


